import React from 'react';

import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import FavoriteIcon from '@material-ui/icons/Favorite';
import Divider from '@material-ui/core/Divider';

const useNav = isAdmin => {
    if(isAdmin){
        return(
            <React.Fragment>
                <List>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="Добавить новость" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="Закреплённые" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="Скрытые" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="Понравившееся" />
                    </ListItem>
                </List>
                <Divider />
                <List>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="Источники" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="Добавить источник" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon><FavoriteIcon /></ListItemIcon>
                        <ListItemText primary="История парсинга" />
                    </ListItem>
                </List>
            </React.Fragment>
        );  
    }
    return(
        <React.Fragment>
            <List>
                <ListItem button>
                <ListItemIcon><FavoriteIcon /></ListItemIcon>
                <ListItemText primary="Понравившееся" />
                </ListItem>
            </List>
            <Divider />
            <List>
                {['All mail', 'Trash', 'Spam'].map((text, index) => (
                <ListItem button key={text}>
                    <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                    <ListItemText primary={text} />
                </ListItem>
                ))}
            </List>
        </React.Fragment>
    );
}

export default useNav;
